실화 - 에덴의 선택(EDEN).2013.HD_REDUNDER','<div>에덴의 선택(EDEN).2013.HD_REDUNDER</div>\r\n<div>에덴의 선택(EDEN).2013.HD_REDUNDER</div>\r\n<div>에덴의 선택(EDEN).2013.HD_REDUNDER</div>\r\n에덴의 선택 밀라노 국제영화제 최우수 작품상/감독상 수상!!!<br>\r\n<br>\r\nhttp://news.sportsseoul.com/read/entertain/1185610.htm<br>\r\n<br>\r\n<br>\r\n우리의 ‘에덴 Eden’은 진정 존재하는가<br>\r\n<br>\r\n영화를 보다 보면 가끔씩 이 영화는 그저 상상 속에 ‘현실’이기를 바랄 때가 있습니다. 예를 들어 저번에 본 영화 ‘도가니’가 그랬고<br>\r\n이번 영화 ‘에덴의 선택’이 그렇습니다. 하지만 이런 영화들은 끔찍한 현실의 극히 일부만을 담고 있다는 점이 관객을 더 슬프게<br>\r\n합니다. 영화를 보는 내내 스스로에게 물었습니다. 우리의 ‘에덴’은 진정 존재하는가?<br>\r\n<br>\r\n요즘 뉴스를 보다 보면 타락한 세상의 바닥을 보여주는 이야기들을 많이 접할 수 있습니다. 장기매매, 납치, 성폭행, 살인 등등...<br>\r\n인간이 저지를 수 있는 죄악의 끝은 어디까지일까요?. 그 한계를 가늠이나 할 수 있을까요? 영화 ‘에덴의 선택’은 그렇게 부정하고 싶은 현실을 적나라하게 비춰내고 있습니다. ‘인신매매’ 를 시작으로, ‘마약’, ‘아기밀매’등 충격적인 소재가 주를 이루고 있지만<br>\r\n에덴의 선택 리뷰 및 상영 제안 배경 (EDEN, 2013)<br>\r\n<br>\r\n암담한 현실과는 대조적으로 영화는 때론 조용하고 편안하게 흘러갑니다.<br>\r\n<br>\r\n감독이 여기서 말하고 싶었던 건 무엇이었을까요? 지옥 같은 현실을 좀 더 부각시키고 싶어서 그녀의 이름이 ‘에덴’으로 붙여진 건<br>\r\n아닐까라는 생각이 듭니다. 사실 너무 무거운 소재를 끌고 가는 스토리여서 처음엔  관객들에게 다가갈 수 있을까라는 의문을<br>\r\n가지게 해준 영화였습니다. 하지만 보면 볼수록 왠지 사람들도 이러한 현실을 알고 있어야 된다는 생각이 들었습니다.<br>\r\n<br>\r\n생각보다 그렇게 잔인하거나 선정적인 내용은 나오지 않았고, 지루하지도 않았던 것 같습니다. 98분 안에 하고 싶은 이야기들이 깔끔하게 연결고리를 짓고 있었습니다. 어두운 현실은 종종 잔잔히 흘러가는 풍경과 아름다운 음악 속에 빠트려 보여주었습니다. 새로 끌려온 여자들을 가둬두고 드넓은 대지를 달리는 차와 함께 주변을 많이 보여주는데 이 또한 색다르게 표현되고 있다고 느꼈습니다. 무엇보다도 ‘인신매매’라는 소재에서만 국한되지 않고 현실의 모순을 더욱더 확장해 나가는 점이 이 영화의 가장 큰 매력이라고 생각합니다. 먹고 먹히는 먹이사슬 같은 사람들의 관계와 진심이란 존재할 수 없는 현실 속에서 그려나가는 상황들은<br>\r\n영화 후반까지 촘촘하게 연결되어 있습니다. 시각의 확장을 느낄 수 있는 점에 있어서 깔끔하게 자신이 전하고 싶은 주제를 다<br>\r\n전달한 부분이 영화를 이끄는 감독의 힘이라는 생각이 듭니다.<br>\r\n<br>\r\n왠지 일어날 수 없는 일들이 일어나고 있다는 느낌? 차라리 SF장르였다면... 느닷없이 외계인이라도 침공했다면, 아니 무서운 귀신들이 주인공을 뒤쫓는 공포영화였다면. 어느 정도 현실과 가장의 차이를 느낄 수 있다고 조용히 안도할 수 있었을 텐데. 저건 진짜가 아니야 라고 스스로를 다독였을 텐데. 매일 매일 만나고 마주하는 같은 사람들에게서. 최소한의 양심과 죄책감을 느낄 수 있을 거라고 생각했던 진정한 ‘사람’의 기준을 그들은 완벽하게 짓 밞고 있었습니다. 모든 기준의 경계가 무너진 느낌이었습니다.<br>\r\n<br>\r\n국내관객들은 영화를 관람 후 영화와 현실이 마주할 때 느껴지는 섬뜩함과 공포, 그리고 씁쓸함을 느낄 것이며<br>\r\n“우리의 ‘에덴’은 진정 존재하는가” 라는 질문을 하게 될것이라 자신 있게 전합니다.<br>\r\n<br>\r\n아무쪼록 블럭버스터 영화는 아니지만 관계자 분께서 긍정적으로 평가하여 주신다면 최선을 다하여 국내관객들이<br>\r\n여성인권의 절실함에 호소 할 수 있도록 최선을 다하겠습니다.  ? 영화 수입/배급사 C 무비 올림<br>\r\n<img alt=\"\" src=\"http://image.yesfile.com/data/2014/03/11/1394510746_McR.jpg\" border=\"0\"><br>\r\n<img alt=\"\" src=\"http://image.yesfile.com/data/2014/03/11/1394510748_o8Fw.jpg\" border=\"0\"><br>\r\n<img alt=\"\" src=\"http://image.yesfile.com/data/2014/03/11/1394510750_Fc4i.jpg\" border=\"0\"><br><img width=\"0\" height=\"0\" alt=\"\" src=\"http://neocontents.co.kr/img/i.php?a=45899842&amp;b=697b64afa7b12c2ad033c7c39dbef20c\">',0,'41412972.9999',1,'112.222.248.221',0,'Y',1526616349,0,1,1528820392,'Y','Y','Y',2695787558,2695787558,'5','0','0','0','0','Y',0,'Y',1394510749,0,0,1,0,0,'',0,0,'S',0,0,0,'Y','',0,378754132,0,12),(10900125,'BD_AN_03','','BD_AN','','','kdy027900','애니사랑해요',8,'','[ 사모님은 여고생 ] 01-13완결 -성인물 로맨스 코믹 드라마-','<div><img width=\"700\" height=\"514\" src=\"http://image.yesfile.com/data/2018/03/03/1520058944_vpxD.jpg\"></div><div><br></div><div><img width=\"700\" height=\"518\" src=\"http://image.yesfile.com/data/2018/03/03/1520058944_vpxD_c.jpg\"></div><div><br></div><div><img width=\"700\" height=\"555\" src=\"http://image.yesfile.com/data/2018/03/03/1520058944_vpxD_c1.jpg\"></div><div><br></div><div><img width=\"690\" height=\"971\" src=\"http://image.yesfile.com/data/2018/03/03/1520058944_vpxD_c2.jpg\"></div><div><br></div><div><img width=\"700\" height=\"518\" src=\"http://image.yesfile.com/data/2018/03/03/1520058944_vpxD_c3.jpg\"></div>',0,'41101647.9999',1,'211.213.166.249',440,'Y',1524572598,0,108,1529825871,'Y','N','Y',4634893743,4634893743,'1','0','0','0','0','Y',0,'Y',1395058998,0,0,1,0,0,'',0,0,'N',0,0,0,'Y','',0,1270876836,0,12),(10990383,'BD_DM_02','','BD_DM','BD_DM','BD_CM_07','kang2739','채민재',8,'','[일드] 아빠와 딸의 7일간 - 제1화~제7화 완결 - 아라가키 유이','\r\n<DIV><IMG onerror=imgErr(this) src=\"http://image.yesfile.com/data/2014/03/30/1396167591_TNSb.jpg\" width=700 height=493></DIV>\r\n<