/STRONG></P>\r\n<P class=con_tx __jindo__id=\"e140733543882577268303\"><STRONG>2차 세계대전 일본군이 점령한 만주에 위치한 여자 포로수용소. 그곳은 여죄수들에 대한 잔혹행위와 성적 착취가 횡행하는 곳으로 황금을 되찾기 위한 저항군의 탈출이 시도된다. 아슬아슬한 짧은 치마, 부풀린 금발머리, 가죽부츠와 채찍 등 영화 곳곳에 강도 높은 성적 암시를 새겨넣는다. 이와 동시에 박진감 넘치는 자동차 추격 장면을 비롯해 산악 총격전, 무술대련에 이르는 액션을 겸비하며 선정성영화와 액션영화의 경계를 자유롭게 넘나든다.<BR>&nbsp;일제말 중국의 한국인거리. 독립군 김대만은 부인 정숙에게 군자금의 은닉장소를 말하고 숨진다. 그러나 그녀는 부녀자들을 수용하는 곳에 잡혀간다. 그 곳은 부녀자들을 내세워 연합군의 공격을 피하고 노동력을 써먹으려는 계산으로 만들어졌다. 여인들은 탈옥을 꿈꾸지만 고압전류가 흐르는 철조망때문에 불가능하다. 어느날 독립군 박대령이 중국통역관을 가장해 들어온다. 그의 도움으로 철조망을 폭파하고 여인들은 탈출에 성공한다. 그리고 뒤쫓아온 일본군들도 섬멸한다.</STRONG></P>\r\n<P class=con_tx __jindo__id=\"e140733543882577268303\"><STRONG></STRONG>&nbsp;</P>\r\n<P class=con_tx __jindo__id=\"e140733543882577268303\"><STRONG></STRONG>&nbsp;</P>\r\n<P class=con_tx __jindo__id=\"e140733543882577268303\"><IMG src=\"http://image.yesfile.com/data/2014/12/21/1419105332_G5qi.jpg\" width=700 height=293>&#65279;<IMG src=\"http://image.yesfile.com/data/2014/12/21/1419105332_G5qi_c.jpg\" width=700 height=293>&#65279;<IMG src=\"http://image.yesfile.com/data/2014/12/21/1419105332_G5qi_c1.jpg\" width=700 height=293>&#65279;<IMG src=\"http://image.yesfile.com/data/2014/12/21/1419105332_G5qi_c2.jpg\" width=700 height=293>&#65279;<IMG src=\"http://image.yesfile.com/data/2014/12/21/1419105333_UpEb.jpg\" width=700 height=293>&#65279;</P>\r\n<P></P>',0,'41238556.9999',1,'220.117.111.94',0,'Y',1493649180,0,54,1530061249,'Y','N','Y',1467919328,1467919328,'5','0','0','0','0','Y',0,'Y',1407335580,0,0,1,0,0,'',0,0,'Y',0,0,0,'E','',0,784064562,1,12),(11972204,'BD_AN_05','','BD_AN','','','kdy027900','애니사랑해요',8,'','[ 뱀파이어 기사 : 1기-2기 ] 완결 -미스테리 환타지 스릴러 액션-','<p><img width=\"594\" height=\"678\" src=\"http://image.yesfile.com/data/2018/06/20/1529482738_w8BC.jpg\"></p><p><br></p><p><img width=\"700\" height=\"467\" src=\"http://image.yesfile.com/data/2018/06/20/1529482738_w8BC_c.jpg\"></p><p><br></p><p><img width=\"700\" height=\"525\" src=\"http://image.yesfile.com/data/2018/06/20/1